INSERT INTO `sys_setting` VALUES (1493771103506665472, 'APP设置组', 3, 'APP提现规则', '1、最新提现服务费规则如下(最低0.1元)：\n ① 0~3千，费率：0.001；\n ② 3千~3万，费率：0.002；\n ③ 3万以上，费率：0.003,2、由于风控原因，目前系统提现只能一天一笔，单笔最大限额5万,3、每笔提现金额<=3千，直接免审核秒提，>3千则需要后台审核(当天处理)，该笔提现金额将入审核中状态,4、每个账号每天同时只能申请一次审核，并且需在每天16:00之前进行申请，过后则需等第二天再申请,5、当天如需重新申请，需等待上一次审核处理完毕或联系客服关闭上一次审核，才能再次发起新的申请,6、后台审核通过后，将直接提现到用户名下的账号中，请留意到账信息，也可以通过审核记录列表查看审核结果,7、如果申请不通过、交易关闭或用户主动取消等，系统会将当天审核中的提现金额与服务费一同原路返还到余额里面,8、当用户取消后当天不能再申请，并且只能在每天23:30前进行操作', '0、系统内测中，所有提现将进入后台审核，不便之处敬请体谅,1、由于风控原因，目前系统提现只能一天一笔，单笔最大限额5万,2、每笔提现金额<=3000元，直接免审核秒提，>3000元则需要后台审核(当天处理)，该笔提现金额将入审核中状态,3、每个账号每天同时只能申请一次审核，并且需在每天21:00之前进行申请，过后则需等第二天再申请(建议早上9:00后),4、当天如需重新申请，需等待上一次审核处理完毕或联系客服关闭上一次审核，才能再次发起新的申请,5、后台审核通过后，将直接提现到用户名下的账号中，请留意到账信息，也可以通过审核记录列表查看审核结果,6、如果申请不通过或交易关闭等，系统会将当天审核中的提现金额原路返还到余额里面', 'LIST', 'TEXTAREA', '主要用于描述APP的提现规则，方便修改', 1, 0, 1, 0, 1501451056482226176, '2022-02-16 10:15:59', '2022-03-21 20:09:19');
