-- ----------------------------
-- Table structure for group_buy
-- ----------------------------
DROP TABLE IF EXISTS `group_buy`;
CREATE TABLE `group_buy`  (
  `group_buy_id` bigint UNSIGNED NOT NULL COMMENT '主键id',
  `product_id` bigint UNSIGNED NOT NULL COMMENT '商品id',
  `show_price` bigint UNSIGNED NOT NULL DEFAULT 0 COMMENT '展示价,使用Long类型,1元就是表示100',
  `limit_num` int UNSIGNED NOT NULL DEFAULT 0 COMMENT '限购数量',
  `group_num` int UNSIGNED NOT NULL DEFAULT 0 COMMENT '已开团数量',
  `pattern` tinyint UNSIGNED NULL DEFAULT 1 COMMENT '开团模式 1普通2阶梯',
  `sort` int UNSIGNED NULL DEFAULT 0 COMMENT '排序',
  `is_publish_status` tinyint UNSIGNED NULL DEFAULT 0 COMMENT '上下线状态:0->flase,1->true',
  `tries_num` tinyint UNSIGNED NOT NULL DEFAULT 0 COMMENT '购买次数限制',
  `deadline_time` datetime NULL DEFAULT NULL COMMENT '活动截止时间',
  `create_time` datetime NULL DEFAULT NULL COMMENT '创建时间',
  `update_time` datetime NULL DEFAULT NULL COMMENT '修改时间',
  `deleted` int UNSIGNED NULL DEFAULT 0 COMMENT '逻辑删除：0->未删除,1->删除',
  `join_num` tinyint UNSIGNED NOT NULL DEFAULT 2 COMMENT '设置参团人数,默认为2个人成为一个团',
  PRIMARY KEY (`group_buy_id`) USING BTREE,
  UNIQUE INDEX `product_id`(`product_id` ASC) USING BTREE COMMENT '商品id唯一'
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '团购' ROW_FORMAT = DYNAMIC;

