-- Table structure for group_order
-- ----------------------------
DROP TABLE IF EXISTS `group_order`;
CREATE TABLE `group_order`  (
  `group_order_id` bigint UNSIGNED NOT NULL COMMENT '主键id',
  `user_id` bigint UNSIGNED NOT NULL COMMENT '用户id',
  `order_no` varchar(40) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '订单号',
  `order_list` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '订单信息',
  `payt_ype` tinyint UNSIGNED NOT NULL COMMENT '支付方式1余额2云闪付3积分抵扣4线下',
  `order_status` tinyint UNSIGNED NOT NULL DEFAULT 0 COMMENT '订单状态1未付款2待发货3已发货4已收货',
  `price` bigint NOT NULL COMMENT '总金额(含邮费),1元就是100',
  `remark` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '备注',
  `total_num` int NULL DEFAULT 0 COMMENT '商品数量',
  `pay_id` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '用于发送模板消息',
  `receive_name` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '姓名',
  `phone` varchar(11) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '0' COMMENT '联系方式',
  `region` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '省市区',
  `detail` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '地址信息',
  `express` bigint UNSIGNED NULL DEFAULT 0 COMMENT '快递费用,1元就是代表100',
  `order_price` bigint UNSIGNED NOT NULL COMMENT '订单金额,1元就是代表100',
  `express_number` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '快递单号',
  `express_name` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '快递名称',
  `score` int UNSIGNED NULL DEFAULT 0 COMMENT '积分,购买可送的积分',
  `form_id` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '用于发送模板消息',
  `express_code` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '快递公司编码',
  `is_group_status` tinyint UNSIGNED NULL DEFAULT 0 COMMENT '团状态 1组团中2成功-1失败',
  `out_refund_no` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '商户退款单号',
  `create_time` datetime NULL DEFAULT NULL COMMENT '创建时间',
  `update_time` datetime NULL DEFAULT NULL COMMENT '修改时间',
  `pay_time` datetime NULL DEFAULT NULL COMMENT '支付时间',
  `delive_time` datetime NULL DEFAULT NULL COMMENT '发货时间',
  `deleted` int UNSIGNED NULL DEFAULT 0 COMMENT '逻辑删除：0->未删除,1->删除',
  PRIMARY KEY (`group_order_id`) USING BTREE,
  INDEX `user_id`(`user_id` ASC) USING BTREE,
  INDEX `order_no`(`order_no` ASC) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '团购订单' ROW_FORMAT = DYNAMIC;

