DROP TABLE IF EXISTS `group_sponsor`;
CREATE TABLE `group_sponsor`  (
  `group_sponsor_id` bigint UNSIGNED NOT NULL COMMENT '主键id',
  `user_id` bigint UNSIGNED NOT NULL COMMENT '用户id',
  `group_buy_id` bigint UNSIGNED NOT NULL COMMENT '关联的团购id',
  `join_num` tinyint UNSIGNED NOT NULL DEFAULT 1 COMMENT '参团人数,代表有几人参加了,发起人那就是只有一个',
  `group_status` tinyint UNSIGNED NOT NULL DEFAULT 3 COMMENT '状态:1->成功,2->正在进行中,3代表失败',
  `scale` tinyint UNSIGNED NOT NULL DEFAULT 0 COMMENT '拼团规模,后面需求改动可以加上在,暂时不用',
  `create_time` datetime NULL DEFAULT NULL COMMENT '创建时间',
  `update_time` datetime NULL DEFAULT NULL COMMENT '修改时间',
  `deleted` int UNSIGNED NULL DEFAULT 0 COMMENT '逻辑删除：0->未删除,1->删除',
  PRIMARY KEY (`group_sponsor_id`) USING BTREE,
  INDEX `user_id`(`user_id` ASC) USING BTREE,
  INDEX `group_buy_id`(`group_buy_id` ASC) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '拼团发起表' ROW_FORMAT = DYNAMIC;

