  `integral_pdt_id` bigint UNSIGNED NOT NULL COMMENT '积分商品id',
  `user_id` bigint UNSIGNED NOT NULL COMMENT '用户id',
  `order_sn` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '订单编号',
