DROP TABLE IF EXISTS `oms_order`;
CREATE TABLE `oms_order`  (
  `order_id` bigint UNSIGNED NOT NULL COMMENT '订单id',
  `user_id` bigint UNSIGNED NOT NULL COMMENT '用户id',
  `coupon_id` bigint UNSIGNED NULL DEFAULT 0 COMMENT '优惠卷id',
  `order_sn` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '订单编号',
  `total_amount` bigint UNSIGNED NOT NULL COMMENT '订单总金额',
  `pay_amount` bigint UNSIGNED NOT NULL COMMENT '应付金额（实际支付金额）',
  `freight_amount` bigint UNSIGNED NULL DEFAULT 0 COMMENT '运费金额,默认为0,也可以有',
  `promotion_amount` bigint UNSIGNED NULL DEFAULT NULL COMMENT '促销优化金额（促销价、满减、阶梯价）',
  `coupon_amount` bigint UNSIGNED NULL DEFAULT NULL COMMENT '优惠券抵扣金额',
  `discount_amount` bigint UNSIGNED NULL DEFAULT NULL COMMENT '管理员后台调整订单使用的折扣金额',
  `pay_type` int UNSIGNED NULL DEFAULT 0 COMMENT '支付方式：0->未支付；1云闪付；2支付宝；3->余额支付',
  `source_type` int UNSIGNED NULL DEFAULT 1 COMMENT '订单来源：0->PC订单；1->app订单',
  `order_status` int UNSIGNED NULL DEFAULT 0 COMMENT '订单状态：0->待付款；1->待发货；2->已发货；3->已完成；4->已关闭；5->无效订单；6->已付款；7->待评价; 8->已核销',
  `order_type` int UNSIGNED NOT NULL COMMENT '订单类型：0->正常订单；1->秒杀订单;2->拼团订单;3->付费会员订单;4->创客订单',
  `delivery_company` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '物流公司(配送方式)',
  `delivery_sn` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '物流单号',
  `auto_confirm_day` int UNSIGNED NULL DEFAULT NULL COMMENT '自动确认时间（天）',
  `integration` int UNSIGNED NULL DEFAULT NULL COMMENT '可以获得的积分',
  `promotion_info` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '活动信息',
  `bill_type` int UNSIGNED NULL DEFAULT 0 COMMENT '发票类型：0->不开发票；1->电子发票；2->纸质发票',
  `bill_header` varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '发票抬头',
  `bill_content` varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '发票内容',
  `bill_phone` varchar(11) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '收票人电话',
  `bill_email` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '收票人邮箱',
  `receiver_name` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '收货人姓名',
  `receiver_phone` varchar(11) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '收货人电话',
  `receiver_code` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '收货人邮编',
  `receiver_province` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '省份/直辖市',
  `receiver_city` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '城市',
  `receiver_region` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '区',
  `receiver_address` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '详细地址',
  `order_note` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '订单备注',
  `is_confirm_status` tinyint UNSIGNED NULL DEFAULT 0 COMMENT '确认收货状态：0->未确认；1->已确认',
  `delete_status` tinyint UNSIGNED NULL DEFAULT 0 COMMENT '删除状态：0->未删除；1->已删除',
  `payment_time` datetime NULL DEFAULT NULL COMMENT '支付时间',
  `delivery_time` datetime NULL DEFAULT NULL COMMENT '发货时间',
  `receive_time` datetime NULL DEFAULT NULL COMMENT '确认收货时间',
  `comment_time` datetime NULL DEFAULT NULL COMMENT '评价时间',
  `create_time` datetime NULL DEFAULT NULL COMMENT '提交时间',
  `update_time` datetime NULL DEFAULT NULL COMMENT '修改时间',
  `order_select` tinyint UNSIGNED NULL DEFAULT NULL COMMENT '0代表是线上发布1代表是线上发货',
  `is_appraise` tinyint UNSIGNED NULL DEFAULT 0 COMMENT '是否评价,商品在已完成收货后评价就是1，未评价就是0',
  `trans_id` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '第三方交易流水号,例如云闪付,支付宝等',
  `cpy_type` tinyint UNSIGNED NULL DEFAULT NULL COMMENT '公司类型订单:0->大尾狐,1->呼啦兔',
  `partner_id` bigint UNSIGNED NULL DEFAULT NULL COMMENT '合伙人',
  `buyer_logon_id` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '付款用户号(支付宝,微信等)',
  `partner_price` bigint UNSIGNED NULL DEFAULT NULL COMMENT '合伙人价格',
  PRIMARY KEY (`order_id`) USING BTREE,
  INDEX `user_id`(`user_id` ASC) USING BTREE,
  INDEX `order_sn`(`order_sn` ASC) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '订单表' ROW_FORMAT = DYNAMIC;

