  `earnest_money` bigint UNSIGNED NOT NULL COMMENT '保证金,使用整数类型Long,1分就是1,100就是1元',
  `total_price` bigint UNSIGNED NOT NULL COMMENT '总金额:价格+保证金,1分就是1,100就是1元',
  `serve_desc` varchar(500) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '服务描述',
  `re_periods` tinyint UNSIGNED NULL DEFAULT NULL COMMENT '退还期数(1-12期可以选择)',
  `is_publish_status` tinyint UNSIGNED NULL DEFAULT NULL COMMENT '上下线状态,0->下线,1->上线',
  `create_time` datetime NULL DEFAULT NULL COMMENT '创建时间',
  `update_time` datetime NULL DEFAULT NULL COMMENT '修改时间',
  PRIMARY KEY (`partner_pdt_id`) USING BTREE,
  UNIQUE INDEX `unique_partner_name`(`partner_name` ASC) USING BTREE COMMENT '合伙人名称唯一索引',
  INDEX `product_id`(`product_id` ASC) USING BTREE
