-- ----------------------------
-- Table structure for pms_product
-- ----------------------------
DROP TABLE IF EXISTS `pms_product`;
CREATE TABLE `pms_product`  (
  `product_id` bigint UNSIGNED NOT NULL COMMENT '主键id',
  `brand_id` bigint UNSIGNED NULL DEFAULT NULL COMMENT '品牌id',
  `pdt_cgy_id` bigint UNSIGNED NULL DEFAULT NULL COMMENT '商品分类id',
  `freight_template_id` bigint UNSIGNED NULL DEFAULT NULL COMMENT '运费模板id',
  `pdt_attribute_cgy_id` bigint UNSIGNED NULL DEFAULT NULL COMMENT '产品属性分类id',
  `product_name` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '商品名称',
  `pic` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '主图',
  `product_sn` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '货号',
  `is_publish_status` tinyint UNSIGNED NULL DEFAULT 1 COMMENT '上架状态：0->下架；1->上架',
  `is_new_status` tinyint UNSIGNED NULL DEFAULT 1 COMMENT '新品状态:0->不是新品；1->新品',
  `is_recommend_status` tinyint UNSIGNED NULL DEFAULT 1 COMMENT '推荐状态；0->不推荐；1->推荐',
  `is_verify_status` tinyint UNSIGNED NULL DEFAULT 0 COMMENT '审核状态：0->未审核；1->审核通过',
  `sort` int UNSIGNED NULL DEFAULT 0 COMMENT '排序',
  `sale` int UNSIGNED NULL DEFAULT 0 COMMENT '销量',
  `price` bigint UNSIGNED NULL DEFAULT NULL COMMENT '价格,使用整数类型Long,1分就是1,100就是1元',
  `promotion_price` bigint UNSIGNED NULL DEFAULT NULL COMMENT '促销价格,使用整数类型Long,1分就是1,100就是1元',
  `gift_growth` int UNSIGNED NULL DEFAULT 0 COMMENT '赠送的成长值',
  `gift_point` int UNSIGNED NULL DEFAULT 0 COMMENT '赠送的积分',
  `use_point_limit` int NULL DEFAULT NULL COMMENT '限制使用的积分数',
  `sub_title` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '副标题,可以为空',
  `description` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '商品描述',
  `original_price` bigint UNSIGNED NULL DEFAULT NULL COMMENT '市场价,使用整数类型Long,1分就是1,100就是1元',
  `stock` int UNSIGNED NULL DEFAULT NULL COMMENT '库存',
  `low_stock` int UNSIGNED NULL DEFAULT NULL COMMENT '库存预警值',
  `unit` varchar(16) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '单位',
  `weight` decimal(10, 2) NULL DEFAULT NULL COMMENT '商品重量，默认为克',
  `preview_status` tinyint UNSIGNED NULL DEFAULT 0 COMMENT '是否为预告商品：0->不是；1->是',
  `service_ids` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '以逗号分割的产品服务：1->无忧退货；2->快速退款；3->免费包邮',
  `album_pics` varchar(500) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '画册图片，连产品图片限制为5张，以逗号分割',
  `detail_title` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '详情描述',
  `detail_desc` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '详情页,富文本',
  `promotion_start_time` datetime NULL DEFAULT NULL COMMENT '促销开始时间',
  `promotion_end_time` datetime NULL DEFAULT NULL COMMENT '促销结束时间',
  `promotion_per_limit` int NULL DEFAULT NULL COMMENT '活动限购数量',
  `promotion_type` int NULL DEFAULT NULL COMMENT '促销类型：0->没有促销使用原价;1->使用促销价；2->使用会员价；3->使用阶梯价格；4->使用满减价格；5->限时购;6->拼团购;7->礼品;8->创客商品',
  `create_time` datetime NULL DEFAULT NULL COMMENT '创建时间',
  `update_time` datetime NULL DEFAULT NULL COMMENT '修改时间',
  `deleted` int UNSIGNED NULL DEFAULT 0 COMMENT '逻辑删除：0->未删除,1->删除',
  `is_handpick_status` tinyint UNSIGNED NULL DEFAULT 0 COMMENT '是否精选,0->不精选,1->精选',
  `is_delicacy_status` tinyint UNSIGNED NULL DEFAULT 0 COMMENT '精致:0->false,1->true',
  `is_style_status` tinyint UNSIGNED NULL DEFAULT 0 COMMENT '穿搭:0->false,1->true',
  `is_live_status` tinyint UNSIGNED NULL DEFAULT 0 COMMENT '是否生活：0->flase,1->true',
  `comment_sum` int UNSIGNED NULL DEFAULT 0 COMMENT '评论数,默认为0',
  `partner_id` bigint UNSIGNED NULL DEFAULT NULL COMMENT '合伙人id',
  `meb_price` bigint NULL DEFAULT NULL COMMENT '会员价',
  `dis_count` decimal(6, 2) NULL DEFAULT NULL COMMENT '折扣比例:0.55->就是55%',
  PRIMARY KEY (`product_id`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '商品信息表' ROW_FORMAT = DYNAMIC;

-- ----------------------------
-- Records of pms_product
-- ----------------------------

-- ----------------------------
-- Table structure for pms_product_attribute
-- ----------------------------
DROP TABLE IF EXISTS `pms_product_attribute`;
CREATE TABLE `pms_product_attribute`  (
  `product_attribute_id` bigint UNSIGNED NOT NULL COMMENT '主键',
  `pdt_attribute_cgy_id` bigint UNSIGNED NOT NULL COMMENT '产品属性分类id',
  `product_attribute_name` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '商品属性参数名称',
  `select_type` int UNSIGNED NULL DEFAULT NULL COMMENT '属性选择类型：0->唯一；1->单选；2->多选',
  `input_type` int UNSIGNED NULL DEFAULT NULL COMMENT '属性录入方式：0->手工录入；1->从列表中选取',
  `input_list` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '可选值列表，以逗号隔开',
  `sort` int UNSIGNED NULL DEFAULT 0 COMMENT '排序字段：最高的可以单独上传图片',
  `filter_type` int UNSIGNED NULL DEFAULT NULL COMMENT '分类筛选样式：0->普通；1->颜色',
  `search_type` int UNSIGNED NULL DEFAULT NULL COMMENT '检索类型；0->不需要进行检索；1->关键字检索；2->范围检索',
  `is_related_status` tinyint UNSIGNED NULL DEFAULT NULL COMMENT '相同属性产品是否关联；0->不关联；1->关联',
  `is_hand_add_status` tinyint UNSIGNED NULL DEFAULT 1 COMMENT '是否支持手动新增；0->不支持；1->支持',
  `type` int NULL DEFAULT NULL COMMENT '属性的类型；0->规格；1->参数',
  `create_time` datetime NULL DEFAULT NULL COMMENT '创建时间',
  `update_time` datetime NULL DEFAULT NULL COMMENT '修改时间',
  PRIMARY KEY (`product_attribute_id`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '商品属性参数表' ROW_FORMAT = DYNAMIC;

