-- Table structure for pms_product_category
-- ----------------------------
DROP TABLE IF EXISTS `pms_product_category`;
CREATE TABLE `pms_product_category`  (
  `pdt_cgy_id` bigint UNSIGNED NOT NULL COMMENT '主键',
  `parent_id` bigint UNSIGNED NOT NULL COMMENT '上机分类的编号：0表示一级分类',
  `pdt_cgy_name` varchar(36) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '产品名称',
