  `product_count` int UNSIGNED NULL DEFAULT 0 COMMENT '点击数',
  `is_nav_status` tinyint UNSIGNED NULL DEFAULT 1 COMMENT '是否显示在导航栏：0->不显示；1->显示',
  `is_show_status` tinyint UNSIGNED NULL DEFAULT 1 COMMENT '显示状态：0->不显示；1->显示',
  `is_hp_ml_status` tinyint UNSIGNED NULL DEFAULT 0 COMMENT '是否显示在悦购自营二级分类,0为false,1为true',
  `sort` int UNSIGNED NULL DEFAULT 0 COMMENT '排序',
  `icon` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '图标',
  `description` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '描述',
  `create_time` datetime NULL DEFAULT NULL COMMENT '创建时间',
  `update_time` datetime NULL DEFAULT NULL COMMENT '修改时间',
  `deleted` int UNSIGNED NULL DEFAULT 0 COMMENT '逻辑删除：0->未删除,1->删除',
  PRIMARY KEY (`pdt_cgy_id`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '产品分类表' ROW_FORMAT = DYNAMIC;

