-- ----------------------------
-- Table structure for pms_product_comment
-- ----------------------------
DROP TABLE IF EXISTS `pms_product_comment`;
CREATE TABLE `pms_product_comment`  (
  `pdt_comment_id` bigint NOT NULL COMMENT '商品评论id',
  `product_id` bigint NULL DEFAULT NULL COMMENT '商品id',
  `user_id` bigint NULL DEFAULT NULL COMMENT '评论用户id',
  `product_star` tinyint NULL DEFAULT 0 COMMENT '商品评价星数：0->5',
  `courier_star` tinyint NULL DEFAULT 0 COMMENT '快递包装星数：0->5',
  `delivery_star` tinyint NULL DEFAULT 0 COMMENT '送货速度星数：0->5',
  `mark_star` tinyint NULL DEFAULT 0 COMMENT '配送员星数：0->5',
  `is_anonymous` tinyint NULL DEFAULT 0 COMMENT '是否匿名,0->false,1->true',
  `product_content` varchar(1000) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '商品评论内容',
  `product_attribute` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '购买时的商品属性',
  `pics` varchar(500) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '上传图片地址;以逗号隔开,最多5张',
  `create_time` datetime NULL DEFAULT NULL COMMENT '创建时间',
  `update_time` datetime NULL DEFAULT NULL COMMENT '修改时间',
  PRIMARY KEY (`pdt_comment_id`) USING BTREE,
  INDEX `product_id`(`product_id` ASC) USING BTREE,
  INDEX `user_id`(`user_id` ASC) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '商品评价表' ROW_FORMAT = DYNAMIC;

-- ----------------------------
-- Records of pms_product_comment
