  `full_price` bigint UNSIGNED NOT NULL COMMENT '满多少价格,1分等于1,100等于1元',
  `reduce_price` bigint UNSIGNED NOT NULL COMMENT '可减去多少价格,1分等于1,100等于1元',
  `create_time` datetime NULL DEFAULT NULL COMMENT '创建时间',
  `update_time` datetime NULL DEFAULT NULL COMMENT '修改时间',
  PRIMARY KEY (`product_full_rn_id`) USING BTREE
