  `product_id` bigint UNSIGNED NOT NULL COMMENT '商品id',
  `vertify_man` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '审核人',
  `is_vertify_status` tinyint UNSIGNED NULL DEFAULT NULL COMMENT '审核状态,0->审核失败,1->审核成功',
  `detail` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '反馈详情',
  `create_time` datetime NULL DEFAULT NULL COMMENT '审核时间',
