-- ----------------------------
-- Table structure for pms_sku_stock
-- ----------------------------
DROP TABLE IF EXISTS `pms_sku_stock`;
CREATE TABLE `pms_sku_stock`  (
  `sku_stock_id` bigint UNSIGNED NOT NULL COMMENT '主键',
  `product_id` bigint UNSIGNED NOT NULL COMMENT '商品id',
  `sku_code` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT 'sku编码，暂时不用,默认为空',
  `price` bigint UNSIGNED NOT NULL COMMENT '价格,1分就是代表1,100就是代表1元',
  `group_price` bigint UNSIGNED NULL DEFAULT 0 COMMENT '商品拼团价格,默认为0就是没有设置拼团价格',
