  `partner_id` bigint NULL DEFAULT NULL COMMENT '合伙人id',
  `code` varchar(36) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '核销编码',
  `start_time` datetime NULL DEFAULT NULL COMMENT '开始时间',
  `end_time` datetime NULL DEFAULT NULL COMMENT '结束时间',
  `is_status` int UNSIGNED NULL DEFAULT 0 COMMENT '状态 0待使用 1已使用 2已过期',
  `create_time` datetime NULL DEFAULT NULL COMMENT '创建时间',
  `update_time` datetime NULL DEFAULT NULL COMMENT '修改时间',
  `deleted` int UNSIGNED NULL DEFAULT 0 COMMENT '逻辑删除：0->未删除,1->删除',
  PRIMARY KEY (`verification_id`) USING BTREE,
  UNIQUE INDEX `unique_code`(`code` ASC) USING BTREE COMMENT '唯一'
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '核销码表' ROW_FORMAT = DYNAMIC;

