  `partner_name` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '核销员名称',
  PRIMARY KEY (`record_id`) USING BTREE,
  UNIQUE INDEX `unique_code`(`code` ASC) USING BTREE COMMENT '唯一'
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '核销记录表' ROW_FORMAT = DYNAMIC;

