-- ----------------------------
-- Table structure for sms_coupon
-- ----------------------------
DROP TABLE IF EXISTS `sms_coupon`;
CREATE TABLE `sms_coupon`  (
  `coupon_id` bigint UNSIGNED NOT NULL COMMENT '主键id',
  `coupon_name` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '优惠卷标题,比如无门槛5元等',
  `platform` tinyint UNSIGNED NULL DEFAULT 0 COMMENT '使用平台：0->全部；1->移动；2->PC',
  `give_type` tinyint UNSIGNED NULL DEFAULT NULL COMMENT '优惠券类型；0->全场赠券；1->会员赠券；2->购物赠券；3->注册赠券',
  `coupon_type` tinyint UNSIGNED NULL DEFAULT NULL COMMENT '1满减卷,2叠加满减卷,3无门槛卷(需要限制大小)',
  `coupon_count` int UNSIGNED NULL DEFAULT NULL COMMENT '配额数量',
  `with_amount` bigint UNSIGNED NULL DEFAULT NULL COMMENT '满多少金额,使用整数类型,1元就是代表100',
  `used_amount` bigint UNSIGNED NULL DEFAULT NULL COMMENT '用卷金额,使用整数类型,1元就是代表100',
  `per_limit` int UNSIGNED NOT NULL COMMENT '每人限领张数',
  `take_count` int UNSIGNED NULL DEFAULT 0 COMMENT '已领取的优惠卷数量',
  `used_count` int UNSIGNED NULL DEFAULT 0 COMMENT '已使用的优惠卷数量',
  `start_time` datetime NULL DEFAULT NULL COMMENT '发放开始时间',
  `end_time` datetime NULL DEFAULT NULL COMMENT '发放结束时间',
  `valid_start_time` datetime NULL DEFAULT NULL COMMENT '使用开始时间',
  `valid_end_time` datetime NULL DEFAULT NULL COMMENT '使用结束时间',
  `coupon_status` int UNSIGNED NULL DEFAULT 1 COMMENT '0失效,1生效,2已结束',
  `note` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '备注',
  `code` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '优惠码',
  `comment_time` datetime NULL DEFAULT NULL COMMENT '评价时间',
  `update_time` datetime NULL DEFAULT NULL COMMENT '修改时间',
  `deleted` int UNSIGNED NULL DEFAULT 0 COMMENT '逻辑删除：0->未删除,1->删除',
  PRIMARY KEY (`coupon_id`) USING BTREE,
  INDEX `coupon_name`(`coupon_name` ASC) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '优惠券表' ROW_FORMAT = DYNAMIC;

-- ----------------------------
-- Records of sms_coupon
-- ----------------------------

