  `coupon_id` bigint UNSIGNED NOT NULL COMMENT '优惠卷id',
  `user_id` bigint UNSIGNED NOT NULL COMMENT '用户id',
  `order_id` bigint UNSIGNED NOT NULL COMMENT '订单id',
  `order_sn` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '订单号码',
  `get_type` tinyint UNSIGNED NULL DEFAULT NULL COMMENT '获取类型：0->后台赠送；1->主动获取',
  `use_status` tinyint UNSIGNED NULL DEFAULT 0 COMMENT '使用状态：0->未使用；1->已使用；2->已过期',
  `create_time` datetime NULL DEFAULT NULL COMMENT '领取时间',
  `update_time` datetime NULL DEFAULT NULL COMMENT '修改时间',
  `use_time` datetime NULL DEFAULT NULL COMMENT '使用时间',
  PRIMARY KEY (`coupon_history_id`) USING BTREE,
  INDEX `idx_user_id`(`user_id` ASC) USING BTREE,
  INDEX `idx_coupon_id`(`coupon_id` ASC) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '优惠券使用、领取历史表' ROW_FORMAT = DYNAMIC;

