-- ----------------------------
-- Table structure for sms_flash_promotion_product
-- ----------------------------
DROP TABLE IF EXISTS `sms_flash_promotion_product`;
CREATE TABLE `sms_flash_promotion_product`  (
  `flash_promotion_pdt_id` bigint UNSIGNED NOT NULL COMMENT '主键id',
  `flash_promotion_id` bigint UNSIGNED NOT NULL DEFAULT 0 COMMENT '限时购id',
  `flash_promotion_sn_id` bigint UNSIGNED NOT NULL DEFAULT 0 COMMENT '限时购场次id,需求增加的时候再用',
  `product_id` bigint UNSIGNED NOT NULL COMMENT '商品id',
  `flash_promotion_price` bigint UNSIGNED NOT NULL COMMENT '当前发布秒杀价格',
  `flash_promotion_count` int UNSIGNED NOT NULL COMMENT '限时购数量，总数量',
  `sort` int NULL DEFAULT 0 COMMENT '排序',
  `create_time` datetime NULL DEFAULT NULL COMMENT '创建时间',
  `update_time` datetime NULL DEFAULT NULL COMMENT '修改时间',
  `flash_promotion_round` int UNSIGNED NOT NULL DEFAULT 1 COMMENT '当前秒杀轮数，例如：第3轮',
  `user_id` bigint NULL DEFAULT NULL COMMENT '当前持有用户ID',
  `publisher_id` bigint NULL DEFAULT NULL COMMENT '发布者ID',
  `sku_stock_id` bigint NULL DEFAULT NULL COMMENT 'skuID',
  `is_publish_status` tinyint NOT NULL COMMENT '上架状态：0->下架；1->上架',
  `flash_product_status` int NOT NULL COMMENT '秒杀商品状态：1->已卖出；2->秒杀中；3->上架; 4->待卖出',
  `flash_promotion_limit` int UNSIGNED NOT NULL COMMENT '每人限购数量',
  `order_id` bigint NULL DEFAULT NULL COMMENT '订单id',
  `flash_promotion_origin_count` int NULL DEFAULT NULL COMMENT '原总数量',
  `cpy_type` tinyint NULL DEFAULT NULL COMMENT '公司类型订单:0->大尾狐,1->呼啦兔',
  `flash_promotion_origin_price` bigint UNSIGNED NULL DEFAULT NULL COMMENT '记录原价格',
  `total_amount` bigint UNSIGNED NULL DEFAULT NULL COMMENT '用户实际收款金额',
  `partner_price` bigint UNSIGNED NULL DEFAULT NULL COMMENT '合伙人价格(合伙人上传时必须要有值)',
  PRIMARY KEY (`flash_promotion_pdt_id`) USING BTREE,
  UNIQUE INDEX `order_id`(`order_id` ASC) USING BTREE COMMENT '订单id索引',
  INDEX `flash_promotion_id`(`flash_promotion_id` ASC) USING BTREE COMMENT '场次索引'
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '商品秒杀与商品关系表' ROW_FORMAT = DYNAMIC;

