-- ----------------------------
-- Table structure for sys_setting
-- ----------------------------
DROP TABLE IF EXISTS `sys_setting`;
CREATE TABLE `sys_setting`  (
  `sys_setting_id` bigint UNSIGNED NOT NULL COMMENT '主键，系统设置ID',
  `setting_group_name` varchar(30) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '系统设置' COMMENT '分组名称，分组时用于显示，可选，可自定义',
  `setting_type` int UNSIGNED NOT NULL COMMENT '设置类型，主要根据该类型确定唯一设置，不能重复，不能变更',
  `setting_key` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '设置名称，表示该项设置的简短含义，用于显示，如：系统设置、APP设置、第三方设置等',
  `setting_value` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL COMMENT '设置值，表示该项设置的值，统一存储为字符串，使用时按类型解析',
  `setting_default_value` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '设置默认值，作为参考与备用，不允许修改；另外当该值不传时，将与设置值相同，而使用时当value为空时，使用该值',
  `setting_value_type` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '值类型，类型为：STRING, INTEGER, DOUBLE, BOOLEAN, JSON, LIST',
  `setting_form_type` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '表单类型，用于前端区分组件，根据内容决定，类型为：TEXT、TEXTAREA、BOOLEAN、NUMBER、DOUBLE、DATE、TIME、DATETIME、IMAGE、IMAGES、JSON',
  `setting_remark` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '设置备注，用于详细描述该设置的作用以及范围等',
  `is_enable` tinyint UNSIGNED NULL DEFAULT 1 COMMENT '是否启用，类型为：0->禁用,1->启用',
  `is_allow_disable` tinyint UNSIGNED NULL DEFAULT 1 COMMENT '是否允许禁用，部分设置不能被禁用，类型为：0->不允许,1->允许',
  `is_allow_update` tinyint UNSIGNED NULL DEFAULT 1 COMMENT '是否允许修改，部分设置不能被修改，类型为：0->不允许,1->允许',
  `is_allow_delete` tinyint UNSIGNED NULL DEFAULT 1 COMMENT '是否允许删除：0->不允许,1->允许',
  `pc_user_id` bigint UNSIGNED NOT NULL COMMENT '操作者用户ID',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `update_time` datetime NULL DEFAULT NULL COMMENT '修改时间',
  PRIMARY KEY (`sys_setting_id`) USING BTREE,
  UNIQUE INDEX `setting_type`(`setting_type` ASC) USING BTREE COMMENT '设置类型'
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '全局设置表（可以新增，但只允许修改部分字段）' ROW_FORMAT = DYNAMIC;

-- ----------------------------
-- Records of sys_setting
-- ----------------------------

