CREATE TABLE `ums_address`  (
  `address_id` bigint UNSIGNED NOT NULL COMMENT '收货地址主键id',
  `user_id` bigint UNSIGNED NOT NULL COMMENT '用户id',
  `contacts` varchar(36) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '联系人',
  `phone` varchar(11) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '联系电话',
  `province_code` int NULL DEFAULT 0 COMMENT '一级地址省编码',
  `province` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '一级地址:省级地址',
  `city_code` int UNSIGNED NOT NULL DEFAULT 0 COMMENT '二级地址:市级地址编码',
  `city` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '二级地址:市级地址',
  `county_code` int UNSIGNED NULL DEFAULT 0 COMMENT '三级地址:县级地址编码',
  `county` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '三级地址:县级地址',
  `client_address` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '详细地址',
  `is_default_status` tinyint UNSIGNED NOT NULL DEFAULT 0 COMMENT '是否默认地址0->false,1->true',
