-- ----------------------------
-- Table structure for ums_bank
-- ----------------------------
DROP TABLE IF EXISTS `ums_bank`;
CREATE TABLE `ums_bank`  (
  `bank_id` bigint UNSIGNED NOT NULL COMMENT '用户银行卡主键id',
  `user_id` bigint UNSIGNED NOT NULL COMMENT '用户id',
  `bank_name` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '银行卡名称',
  `bank_code` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '银行卡编码',
  `bank_card` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '银行卡卡号',
  `bank_img` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '银行卡(背景颜色/背景图片)',
  `bank_address` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '所在地',
  `bank_phone` varchar(11) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '绑定银行卡的手机号',
  `is_bank_type` tinyint UNSIGNED NOT NULL DEFAULT 0 COMMENT '银行卡类型:0为储蓄卡1为信用卡',
  `is_lock_status` tinyint UNSIGNED NULL DEFAULT 1 COMMENT '银行卡是否被锁定:0->false,1->true',
  `audit_status` tinyint UNSIGNED NULL DEFAULT 2 COMMENT '认证状态:0审核失败1审核成功2待审核',
  `create_time` datetime NULL DEFAULT NULL COMMENT '创建时间',
  `update_time` datetime NULL DEFAULT NULL COMMENT '修改时间',
