-- ----------------------------
-- Table structure for ums_income
-- ----------------------------
DROP TABLE IF EXISTS `ums_income`;
CREATE TABLE `ums_income`  (
  `income_id` bigint NOT NULL COMMENT '主键',
  `user_id` bigint NOT NULL COMMENT '用户id',
  `income` bigint NOT NULL COMMENT '收入=收益,1元就是100',
  `expenditure` bigint NOT NULL COMMENT '支出=提现,1元就是100',
  `balance` bigint NOT NULL COMMENT '结余',
  `today_income` bigint NULL DEFAULT NULL COMMENT '今日收益(所有类型的收益)，1元就是100',
  `all_income` bigint NOT NULL COMMENT '总收益，不断累加',
  `income_type` int NOT NULL COMMENT '收益类型:-2->系统补还,-1->系统扣除,0->邀请收益,1->秒杀收益，2->余额提现，3->普通收益，4->审核资金，5->审核退还，6->分佣收益，7->商家收益,8->创客收益,9->余额支付,10->扣除服务费,11->退还服务费',
  `detail_source` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '来源,支付成功回调后拼接字符串保存',
  `income_no` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '支付宝订单号',
  `order_trade_no` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '商户订单号自己用',
  `pay_type` int UNSIGNED NULL DEFAULT 0 COMMENT '支付/收款方式：0->未支付；1云闪付，2支付宝，3余额',
  `remark` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '备注，只用于系统，不显示给用户',
  `deleted` tinyint(1) NOT NULL DEFAULT 0 COMMENT '逻辑删除：0->未删除；1->删除',
  `origin_type` bit(1) NULL DEFAULT NULL COMMENT '来源类型:0->平台回购,1->用户秒杀购买',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `update_time` datetime NULL DEFAULT NULL COMMENT '修改时间',
  `flash_promotion_pdt_id` bigint UNSIGNED NULL DEFAULT NULL COMMENT '秒杀商品主键id',
  PRIMARY KEY (`income_id`) USING BTREE,
  UNIQUE INDEX `flash_promotion_pdt_id`(`flash_promotion_pdt_id` ASC) USING BTREE COMMENT '秒杀商品主键索引',
  INDEX `user_id`(`user_id` ASC) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '收益表' ROW_FORMAT = DYNAMIC;

-- ----------------------------
-- Records of ums_income
-- ----------------------------

