-- ----------------------------
-- Table structure for ums_user
-- ----------------------------
DROP TABLE IF EXISTS `ums_user`;
CREATE TABLE `ums_user`  (
  `user_id` bigint UNSIGNED NOT NULL COMMENT '用户id',
  `phone` varchar(11) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '手机号码',
  `password` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '密码',
  `nickname` varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '昵称',
  `head_portrait` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '/headPortrait/ums_user_default.png' COMMENT '头像',
  `openid` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '微信OPENID',
  `role_id` int UNSIGNED NOT NULL DEFAULT 0 COMMENT '角色:0普通用户用户,1高级用户,2系统用户',
  `is_user_status` tinyint UNSIGNED NULL DEFAULT 1 COMMENT '0->禁用；1->启用',
  `integral_sum` bigint UNSIGNED NULL DEFAULT 0 COMMENT '积分数量',
  `alipay_name` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '支付宝姓名',
  `alipay_account` varchar(36) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '支付宝账号',
  `pay_password` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '支付密码',
  `payment_type` tinyint UNSIGNED NULL DEFAULT 0 COMMENT '升级支付类型：0->升级会员-未付款；1->升级会员-已付款',
  `user_image_string` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '人脸肖像数据，采用Hash512压缩后再对比',
  `is_exchange_gift` tinyint UNSIGNED NULL DEFAULT 0 COMMENT '礼品；0->未领取；1->已领取',
  `is_active` tinyint UNSIGNED NULL DEFAULT NULL COMMENT '0->不活跃 1 活跃',
  `deleted` int UNSIGNED NULL DEFAULT 0 COMMENT '逻辑删除：0->未删除；1->删除',
  `create_time` datetime NULL DEFAULT NULL COMMENT '注册时间',
  `update_time` datetime NULL DEFAULT NULL COMMENT '修改时间',
  `parent_id` bigint UNSIGNED NULL DEFAULT 0 COMMENT '上级id',
  `invite_time` datetime NULL DEFAULT NULL COMMENT '邀请时间',
  PRIMARY KEY (`user_id`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = 'app用户表' ROW_FORMAT = DYNAMIC;

-- ----------------------------
-- Records of ums_user
-- ----------------------------

-- ----------------------------
-- Table structure for ums_user_blacklist
-- ----------------------------
DROP TABLE IF EXISTS `ums_user_blacklist`;
CREATE TABLE `ums_user_blacklist`  (
  `bl_id` bigint UNSIGNED NOT NULL COMMENT '黑名单ID',
  `bl_phone` varchar(11) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '黑名单号码，该名单的号码不能注册登录',
  `bl_name` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '用户名称，方便后台查看',
  `is_enable` tinyint UNSIGNED NULL DEFAULT 1 COMMENT '是否启用，0->不启用，1->启用，默认启用',
  `remark` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '备注',
  `pc_user_id` bigint NOT NULL COMMENT '修改者用户id',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `update_time` datetime NULL DEFAULT NULL COMMENT '修改时间',
  PRIMARY KEY (`bl_id`) USING BTREE,
  UNIQUE INDEX `bl_phone`(`bl_phone` ASC) USING BTREE COMMENT '唯一索引'
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci ROW_FORMAT = DYNAMIC;

