-- ----------------------------
-- Table structure for ums_user_invite_rule
-- ----------------------------
DROP TABLE IF EXISTS `ums_user_invite_rule`;
CREATE TABLE `ums_user_invite_rule`  (
  `invite_rule_id` bigint UNSIGNED NOT NULL COMMENT '主键',
  `agent_level` int UNSIGNED NULL DEFAULT NULL COMMENT '代理等级',
  `min_total_amount` decimal(10, 6) UNSIGNED NULL DEFAULT NULL COMMENT '最小阈值',
  `max_total_amount` decimal(10, 6) UNSIGNED NULL DEFAULT NULL COMMENT '最大阈值',
  `commission_rate` decimal(10, 6) UNSIGNED NULL DEFAULT NULL COMMENT '佣金比例',
  `income_type` int UNSIGNED NULL DEFAULT NULL COMMENT '分佣规则类型：0表示邀请代理分佣比例，1表示成为团长最低人数',
  `describe` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '描述',
  `create_time` datetime NULL DEFAULT NULL COMMENT '创建时间',
  PRIMARY KEY (`invite_rule_id`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '用户邀请佣金规则表' ROW_FORMAT = DYNAMIC;

